import React,{Component} from "react";
import {Div0,Title,ChooseDiv,TitleText,ChooseTitle} from'./style';
const NavItemHeight = 40;
const NavTitleHeight = 25;
const SidebarNavTitle = styled.div`
    height: ${NavTitleHeight}px;
    line-height: ${NavTitleHeight}px;
    padding: 0 20px;
    font-size: 16px;
    text-align: left;
    background-color: #f0efee;
    color: rgba(0, 0, 0, 0.5);
    font-weight: 600;

    /* &:not(:first-of-type) {
        border-top: 1px solid #e5e5e5;
    } */
`;
class SideBar extends Component{
    render(){
        return (
                <Div0>
                    <Title>
                        <img src='https://i.imgur.com/SOaMg6w.png'  height={64} width={100}></img>
                        <TitleText>管理系統</TitleText>
                    </Title>
                    <ChooseDiv>
                        <SidebarNavTitle>
                            購買
                        </SidebarNavTitle>
                        <ChooseTitle>三角肌</ChooseTitle>
                        <ChooseTitle>下肢</ChooseTitle>
                    </ChooseDiv>
                </Div0>
        )}}
export default SideBar;
